import { Box, Card, Flex, Image } from '@chakra-ui/react'

const Dashboard = () => {
  return (
    <Flex direction='row' display='flex' gap='8px'>
      <Box bgColor='blue.50'></Box>
      <Box></Box>
      <Box></Box>
      <Box></Box>
    </Flex>
  );
};

export default Dashboard;
